	add("homebody", "{\"term\":\"homebody\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|home|body|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who prefers to remain at home, rather than participate in social events elsewhere\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Although my uncle likes to travel, my aunt is a \u0027\u0027homebody\u0027\u0027, so he usually comes with us while she stays home with her cats\", \"priority\":2}]}, \"synonyms\":{}}");

