	add("homeostasis", "{\"term\":\"homeostasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined from Ancient greek (to 1453) \u0027ὅμος\u0027 (similar) + \u0027ιστημι\u0027 (standing still) stasis (from \u0027στάσις\u0027 by {{w|Walter Bradford Cannon}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability of a system or living organism to adjust its internal environment to maintain a state of dynamic constancy; such as the ability of warm-blooded animals to maintain a stable temperature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027Professional Guide to Pathophysiology\u0027, Lippincott, Williams, \u0026amp; Wilkins, page 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When \u0027\u0027homeostasis\u0027\u0027 is disrupted by an external stressor - such as injury, lack of nutrients, or invasion by parasites or other organisms - illness may occur\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Such a dynamic equilibrium or balance\", \"priority\":4}]}, \"synonyms\":{}}");

